import React from 'react';
import './styles/beauty-input.css';

class AuthInput extends React.Component {

	constructor(props) {
		super(props);
	}
	
	render() { 
		return <div>
            <input id={this.props.name} type="text" placeholder={this.props.name} required/>
            <span>{this.props.name}</span>
        </div>
	}
}
export { AuthInput };
